import React, { Component } from 'react'
import {HomeWrapper, HomeLeft, HomeRight} from './style'

class Home extends Component{
    render() {
        return (<HomeWrapper>
            <HomeLeft>
                <img  className="banner-img" src="https://scontent.ftpe4-2.fna.fbcdn.net/v/t1.0-9/119928261_3504183522977112_6727443703106507929_o.jpg?_nc_cat=109&_nc_sid=730e14&_nc_ohc=1raVg3eQrgUAX9oWkrw&_nc_ht=scontent.ftpe4-2.fna&oh=12fcb73213597a45232c7ca695ba3e64&oe=5F972BDB"></img>
            </HomeLeft>
            <HomeRight></HomeRight>
        </HomeWrapper>)
    }
}

export default Home
